import React, { useState } from "react";
import logo from "./logo.svg";
import "./App.css";

import { IShoppingSale } from "./api/structures/shoppings/sales/IShoppingSale";
import ProductSection from "./components/ProductSection";
import { SALES } from "./utils/common/constants";
import { IShoppingSaleUnitStock } from "./api/structures/shoppings/sales/IShoppingSaleUnitStock";
interface Props {
  sale: IShoppingSale;
}

SALE_INDEX;

function App({ sale }: Props) {
  const [selectedStocks, setSelectedStocks] = useState<{
    [key: string]: IShoppingSaleUnitStock;
  }>({});
  return (
    <div className="App">
      <form>
        <ul>
          {sale.units.map((unit) => (
            <li key={unit.id}>
              <ProductSection unit={unit} />
            </li>
          ))}
        </ul>
      </form>
    </div>
  );
}

export default App;
